  props: {
    type: {
      type: String,
      required: true
    },
    active: {
        type: Boolean,
        default: false
    }
  },
  setup(props) {
    const icon = computed(() => iconsConfig[props.type])

    if (!icon.value) {
      console.warn(`Icon type "${props.type}" not found in iconsConfig.`)
      return () => null
    }

    const { viewBox, paths } = icon.value
    
    // Define a cor da linha com base no estado 'active'
    // O seu HTML original usa 'text-[#0641fc]' para ativo e 'text-[#2a2e33]' para inativo.
    // Usamos 'currentColor' no SVG e as classes Tailwind externas controlam a cor.
    const strokeColor = 'currentColor'
    const fillColor = 'currentColor'

    return () => h('svg', {
      xmlns: 'http://www.w3.org/2000/svg',
      width: '18', // Definindo um tamanho fixo para manter a consistncia
      height: '18',
      viewBox: viewBox,
      fill: 'none',
    }, paths.map(path => h('path', {
      d: path.d,
      stroke: path.stroke === 'currentColor' ? strokeColor : path.stroke,
      'stroke-width': path['stroke-width'],
      'stroke-linecap': path['stroke-linecap'],
      'stroke-linejoin': path['stroke-linejoin'],
      fill: path.fill === 'currentColor' ? fillColor : path.fill, // Aplica fill se estiver definido
      'fill-rule': path['fill-rule'],
      'clip-rule': path['clip-rule']
    })))
  }
})


